import Total from "./Total";

const Networth = ({
  networths,
  formatToCurrency,
  currency,
  currency_codes
}) => {
  return (
    <table className="table">
      <tbody>
        {Object.entries(networths).map(([key, value]) => (
          <Total
            key={key}
            total={value}
            formatToCurrency={formatToCurrency}
            currency={currency}
            currency_codes={currency_codes}
          />
        ))}
      </tbody>
    </table>
  );
};

export default Networth;
